paires=["()","{}","[]","<>"]
par="(){}[]<>"

n=int(input())

for _ in range(n):
    e=list(input())
    i=0
    while i<len(e):
        if e[i] not in par:
            del(e[i])
            continue
        i+=1
    i=0
    while i<len(e):
        if i<=0:
            i+=1
            continue
        c=False
        for p in paires:
            if e[i] in p and e[i-1] in p:
                del(e[i],e[i-1])
                c=True
                break
        if c:
            i-=1
            continue
        i+=1

    if e:
        print("false")
    else:
        print("true")
